    public static FilmCategories parserGenere(String parola) {

        if (parola.compareTo("Animazion") == 0) {
            return FilmCategories.Animation;
        }
        if (parola.compareTo("Adventure") == 0) {
            return FilmCategories.Adventure;
        }
        if (parola.compareTo("Biography") == 0) {
            return FilmCategories.Biography;
        }
        if (parola.compareTo("Commedia") == 0) {
            return FilmCategories.Commedia;
        }
        if (parola.compareTo("Documentary") == 0) {
            return FilmCategories.Documentary;
        }
        if (parola.compareTo("Drama") == 0) {
            return FilmCategories.Drama;
        }
        if (parola.compareTo("Erotic") == 0) {
            return FilmCategories.Erotic;
        }
        if (parola.compareTo("Science") == 0) {
            return FilmCategories.Science;
        }
        if (parola.compareTo("Fantasy") == 0) {
            return FilmCategories.Fantasy;
        }
        if (parola.compareTo("War") == 0) {
            return FilmCategories.War;
        }
        if (parola.compareTo("Horror") == 0) {
            return FilmCategories.Horror;
        }
        if (parola.compareTo("Musical") == 0) {
            return FilmCategories.Musical;
        }
        if (parola.compareTo("Porno") == 0) {
            return FilmCategories.Porno;
        }
        if (parola.compareTo("Hystory") == 0) {
            return FilmCategories.Hystory;
        }
        if (parola.compareTo("Thriller") == 0) {
            return FilmCategories.Thriller;
        }
        if (parola.compareTo("Western") == 0) {
            return FilmCategories.Western;
        }
        //etc etc
        return null;
    }
 
